import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (

    <div className="App">
      <div class="navbar">
  <a class="active" href="Homepage.html">Budget</a> 
  <a href="#">Search</a> 
  <a href="#">Contact</a> 
  <a href="stock.html">Stocks</a>

    </div>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="Homepage.html"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

      </header>
    </div>
  );
}

export default App;
